import React, { useState } from 'react';

const App = () =>{

    const state = useState()
    const [count, setValue] = useState(0)

    const IncNum = () => {
        setValue(100)
    }

    return(
        <>
            <div>
                <h1>{count}</h1>
                <button onClick={IncNum}>Click Me</button>
            </div>
        </>
    )
}

export default App;
